import React from 'react'
import {Portal} from '../../components/'
function ModalOrder({isOpen}) {
	return (
		<>
			{
				isOpen &&
				<Portal>
					<div className='sub-window'>
						<div className="sub-window__content">
						
						</div>
					</div>
				</Portal>
			}
		</>
	)
}

export default ModalOrder
